The following updates Part I, Item 1. “Business—Government Regulation—Privacy and Security Laws—California Consumer Privacy Act” in our 2023 Form 10-K:
California Consumer Privacy Act The California Consumer Privacy Act, as amended by the California Privacy Rights Act (“CPRA,” and together with the California Consumer Privacy Act, the “CCPA”), confers to California consumers, among other things, the right to receive notice of the categories of personal information that will be collected by a business, how the business will use and share the personal information, and the categories of third parties who will receive the personal information. The CCPA also confers rights to access, delete, correct, or request a portable data set, the right to limit processing of “sensitive personal information,” and the right to receive equal service and pricing from a business after exercising a consumer right granted by the CCPA. In addition, the CCPA allows California consumers the right to opt out of the “sale” of their personal information, which the CCPA defines broadly as any disclosure of personal information to a third party in exchange for monetary or other valuable consideration. The CCPA also allows California consumers to opt out of the “sharing” of information, which restricts a company’s use of personal information for cross-context behavioral advertising. The CCPA also requires a business to implement reasonable security procedures to safeguard personal information against unauthorized access, use, or disclosure and imposes purpose limitation, data minimization, data retention and other security compliance obligations on regulated businesses. The CCPA requires businesses to include specific provisions in contracts with third parties that process data on a business’s behalf regarding the third party’s processing and management of such data.
